import React from 'react';
import { Routes, Route } from 'react-router-dom';
import HeaderStyle2 from './HeaderStyle2'; // Adjust the path as needed
import Main from './Layout/Main'; // Adjust the path as needed

function App() {
  return (
    <div>
      <HeaderStyle2 />
      <Routes>
        <Route path="/" element={<Main />} />
        {/* Add other routes here */}
      </Routes>
    </div>
  );
}

export default App;
